import React from 'react';

const ItemVariants = ({ variants, onSelectVariant }) => {
  return (
    <div>
      {variants.map(variant => (
        <div key={variant.id}>
          <label>
            <input
              type="checkbox"
              checked={variant.selected}
              onChange={() => onSelectVariant(variant)}
            />
            <h3>{variant.nominal}</h3>
            <p>{variant.price}</p>
          </label>
        </div>
      ))}
    </div>
  );
};

export default ItemVariants;
